import * as React from 'react';

import { isFunction } from '../shared/utils';
import { UseSearchFieldProps } from '../types';
import { useComposeRefsCallback } from '../../hooks/useComposeRefsCallback';

const ESCAPE_KEY = 'Escape';
const ENTER_KEY = 'Enter';
const DEFAULT_KEYS = new Set([ESCAPE_KEY, ENTER_KEY]);

export const useSearchField = ({
  onSubmit,
  onClear,
  externalRef,
}: UseSearchFieldProps) => {
  const [value, setValue] = React.useState<string>('');
  const internalRef = React.useRef<HTMLInputElement>(null);
  const composedRefs = useComposeRefsCallback({ externalRef, internalRef });

  const onClearHandler = React.useCallback(() => {
    setValue('');
    internalRef?.current?.focus();
    if (isFunction(onClear)) {
      onClear();
    }
  }, [setValue, onClear]);

  const onSubmitHandler = React.useCallback(
    (value: string) => {
      if (isFunction(onSubmit)) {
        onSubmit(value);
      }
    },
    [onSubmit]
  );

  const onKeyDown = React.useCallback(
    (event) => {
      const { key } = event;

      if (!DEFAULT_KEYS.has(key)) {
        return;
      }

      event.preventDefault();

      if (key === ESCAPE_KEY) {
        onClearHandler();
      } else if (key === ENTER_KEY) {
        onSubmitHandler(value);
      }
    },
    [value, onClearHandler, onSubmitHandler]
  );

  const onInput = React.useCallback(
    (event) => {
      setValue(event.target.value);
    },
    [setValue]
  );

  const onClick = React.useCallback(() => {
    onSubmitHandler(value);
  }, [onSubmitHandler, value]);

  return {
    value,
    onClearHandler,
    onKeyDown,
    onInput,
    onClick,
    composedRefs,
  };
};
import * as React from 'react';

export interface UseComposeRefsCallbackProps<RefType> {
  externalRef: React.ForwardedRef<RefType>;
  internalRef: React.MutableRefObject<RefType>;
}

export type UseComposeRefsCallbackReturn<RefType> = (node: RefType) => void;

/**
 *  Creates ref callback to compose together external and internal refs
 */
export const useComposeRefsCallback = <RefType,>({
  externalRef,
  internalRef,
}: UseComposeRefsCallbackProps<RefType>): UseComposeRefsCallbackReturn<RefType> => {
  return React.useCallback((node) => {
    // Handle callback ref
    if (typeof externalRef === 'function') {
      externalRef(node);
    } else if (externalRef != null) {
      externalRef.current = node;
    }

    internalRef.current = node;
  }, []);
};
import { strHasLength } from '../shared/utils';

/**
 * Slice a collection based on page index (starting at 1)
 */
export const getItemsAtPage = <T>(
  items: T[],
  page: number,
  itemsPerPage: number
) => {
  if (page < 1 || itemsPerPage < 1) {
    return [];
  }

  const startIndex = (page - 1) * itemsPerPage;
  return items.slice(startIndex, startIndex + itemsPerPage);
};

/**
 * Recursively find a keyword within an object (case insensitive)
 */
export const itemHasText = (item: unknown, text: string): boolean => {
  if (strHasLength(item)) {
    return item.toLowerCase().includes(text.toLowerCase());
  }

  if (typeof item === 'object' && item !== null) {
    return Object.values(item).some((subItem) => itemHasText(subItem, text));
  }

  return false;
};

/**
 * Computes the amount of available pages
 */
export const getPageCount = (totalItems: number, itemsPerPage: number) =>
  Math.ceil(totalItems / itemsPerPage);
